import "./Items.css";

function ItemCard(props) {
  return (
    <div className="itemCard">
      <img src={require("./shirtIcon.png")} width="200" alt="altText" />
      <div className="itemCardHeader">{props.name}</div>
      <div className="itemCardText">Страна: {props.country}</div>
      <div className="itemCardText">{props.size}</div>
      <div className="itemCardText">{props.price}</div>
    </div>
  );
}

export default ItemCard;
